sys_variable_value.value:
(function execute(inputs, outputs) {
  var projectId = {};
  var shareIds = [];
  shareIds = inputs.shareds;
  if(shareIds != ""){
    outputs.shareds = JSON.stringify(shareIds);
  }
  else{
    outputs.shareds = "";
  }
})(inputs, outputs);

